INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (1, 107501, 0, 1, 40001, 37, 150, "ぺコリーヌ", 8, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (2, 107601, 0, 1, 40001, 38, 150, "コッコロ", 8, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (3, 107801, 0, 1, 40001, 39, 150, "キャル", 8, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (4, 107701, 0, 1, 40001, 40, 150, "スズメ", 8, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (5, 107901, 0, 1, 40001, 41, 150, "タマキ", 8, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (6, 107501, 0, 2, 40001, 42, 150, "ぺコリーヌ", 8, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (7, 107601, 0, 2, 40001, 43, 150, "コッコロ", 8, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (8, 107801, 0, 2, 40001, 44, 150, "キャル", 8, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (9, 107701, 0, 2, 40001, 45, 150, "スズメ", 8, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪");
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (10, 107901, 0, 2, 40001, 46, 150, "タマキ", 8, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？");
